const WordContainer = styled.div`
    display: flex;
    border: solid 1px black;
`;

const Letter = styled.div`
    border: solid 1px green;
    border-radius: 4px;
    background-color: green;
    color: white;
`;


export default function WordDisplay({ word }) {
    return (
        <WordContainer aria-label={word}>
            {[...word].map(letter => (
                letter
            ))}
        </WordContainer>
    );
}
